(()=>{"use strict";const e=()=>{const e=[{name:"Default",value:"0",todo:[]}];return{projects:e,addProject:t=>{const n={name:t.name,value:t.value,todo:t.todo};e.push(n)},deleteProject:t=>{e.splice(e[t.value],1)}}},t=()=>({proj:()=>{const t=document.getElementById("content"),n=document.createElement("div");n.setAttribute("class","project-section"),t.appendChild(n);const o=document.createElement("h2");n.appendChild(o),o.innerHTML="Projects";for(let t=0;t<e().projects.length;t+=1){const o=document.createElement("li");o.setAttribute("class","project"),o.innerHTML=`${e().projects[t].name}`,n.appendChild(o)}},navbar:()=>{const e=document.getElementById("content"),t=document.createElement("div");t.setAttribute("class","navbar"),e.appendChild(t);const n=document.createElement("h1");n.setAttribute("id","nav-text"),t.appendChild(n),n.innerHTML="To-Do List App"}});t().navbar(),t().proj()})();